import React, { useState } from 'react';
import Drawer from '@material-ui/core/Drawer';
import IconButton from '@material-ui/core/IconButton';
import ChevronRightIcon from '@material-ui/icons/ChevronRight';
import { makeStyles, useTheme } from '@material-ui/core/styles';
import ChatIcon from '@material-ui/icons/ChatTwoTone';
import ChatBubbleIcon from '@material-ui/icons/ChatBubbleTwoTone';
import TextField from '@material-ui/core/TextField';

const drawerWidth = 0;

const useStyles = makeStyles((theme) => ({
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
  },
  drawerPaper: {
    width: 240,
    marginRight: 0,
  },
  drawerHeader: {
    display: 'flex',
    alignItems: 'center',
    padding: theme.spacing(0, 1),
    marginRight: 0,
    // necessary for content to be below app bar
    ...theme.mixins.toolbar,
    justifyContent: 'flex-start',
  },

}));


const TextChat = () => {
    const classes = useStyles();
    const theme = useTheme();
    const [isOpen, setIsOpen] = useState(false);

    const handleClick = () => {
        setIsOpen(!isOpen);
    }

    return (
        <div>
            <button
                onClick={handleClick}
                style={{background: "#21242c",
                  border: "#383b43",
                  borderStyle: "solid",
                  borderWidth: "1px",
                  padding: "0.45em"
                }}
            >
                {isOpen?<ChatBubbleIcon/>:<ChatIcon/>}
            </button>
            <Drawer
                className = {classes.drawer}
                anchor = 'right'
                variant = 'persistent'
                open = {isOpen}
                classes={{
                    paper: classes.drawerPaper,
                  }}
            >
                <div className={classes.drawerHeader} style = {{marginRight: '0%'}}>
                    <IconButton onClick={handleClick}>
                        <ChevronRightIcon/>
                    </IconButton>
                    <p style = {{marginBottom: '0rem'}}>In call messages</p>
                </div>
                <div>HI</div>
                <footer style = {{display: 'inline-block', position: 'absolute', bottom: '7.5%', width: '100%', background: '#fff', color: 'black'}}>
                  <form>
                  <TextField id="standard-basic" label="Standard" />
                  </form>
                </footer>
            </Drawer>
        </div>
    );
}

export default TextChat;
